		request.get(`location/${woeId}/${formattedDate}/`).end((err, res) => {
			expect(res.status).to.eql(200);
			expect(res.body).to.not.be.null;
			expect(res.body[0].applicable_date).eql(
				new Intl.DateTimeFormat('se-SE').format(todaysDate)
			);
			done();
		});
	});
});

